const {BaseModel} = require('@ucd-lib/cork-app-utils');

class ElasticSearchModel extends BaseModel {

  constructor() {
    super();

    this.config = {};

    this.from = 0;
    this.size = 50;
    this.sort = {
      key : '',
      order : ''
    }

    this.register('ElasticSearchModel');
  }

  /**
   * @method
   * @description Triggers search-update event
   * 
   * @param {Object} body
   * 
   * @returns {Promise}
   */
  async search(body = {}) {
    body.aggs = {};

    body.from = this.from;
    body.size = this.size;

    if( this.sort.key ) {
      body.sort = [{[this.sort.key] : this.sort.order}];
    } else if( body.sort ) {
      delete body.sort;
    }

    this._addFacetsToBody(body);

    return await this.service.search(body);
  }

  async defaultSearch() {
    var body = {
      aggs : {},
      from : 0,
      size : this.size
    };

    return await this.service.defaultSearch(body);
  }

  textSearch(text, options = {}) {
    var body = this.getSearch().request;

    this.ensurePath('query.bool.must', []);
    this.removeFromArray(body.query.bool.must, 'multi_match');

    if( !text ) {
      this.cleanEmptyLeaves();
      if( options.exec ) this.search(body);
      return body;
    }

    body.query.bool.must.push({
      multi_match : {
        query : text,
        fields : ['title', 'desciption']
      }
    });

    if( options.exec ) {
      this.setPaging(); // reset page
      return this.search(body);
    }

    return body;
  }

  _addFacetsToBody(body) {
    if( !this.config ) return;

    for( var key in this.config.facets ) {
      if( this.config.facets[key].type === 'facet' ) {
        body.aggs[key] = {
          terms : { 
            field : key,
            size : 1000
          }
        }
      } else if( this.config.facets[key].type === 'range' ) {
        body.aggs[key+'-min'] = {
          min : { 
            field : key
          }
        }
        body.aggs[key+'-max'] = {
          max : { 
            field : key
          }
        }
      }
    }
  }

  getDefaultSearch() {
    var currentState = this.getState().defaultSearch;
  }

  getSearch() {
    return this.store.getSearch();
  }

  getDefaultSearch() {
    return this.store.getDefaultSearch();
  }

  getSuggest() {
    return this.store.getSuggest();
  }

  setSort(key, order, exec) {
    this.sort = {key, order};
    if( exec ) this.search(this.getSearch().request);
  }

  setPaging(from = 0, size = 10, exec) {
    this.from = from;
    this.size = size;

    if( exec ) this.search(this.getSearch().request);
  }

  clearFilters() {
    var body = this.getSearch().request;
    if( body.query ) delete body.query;

    this.setPaging(); // reset page
    this.search(body);
    return body;
  }

  appendFilter(key, value, exec) {
    this.ensurePath('query.bool.filter', []);
    var body = this.getSearch().request;

    var arr = body.query.bool.filter;
    var updated = false;

    for( var i = 0; i < arr.length; i++ ) {
      if( arr[i].terms[key] ) {
        arr[i].terms[key].push(value);
        updated = true;
        break;
      }
    }

    if( !updated ) {
      arr.push({
        terms : {
          [key] : [value]
        }
      });
    }

    if( exec ) {
      this.setPaging(); // reset page
      this.search(body);
    }

    return body;
  }

  removeFilter(key, value, exec) {
    this.ensurePath('query.bool.filter', []);
    var body = this.getSearch().request;

    var arr = body.query.bool.filter;

    for( var i = 0; i < arr.length; i++ ) {
      if( arr[i].terms[key] ) {
        if( arr[i].terms[key].indexOf(value) > -1 ) {
